In the Parser trait, the Output does not ultimately contain data borrowed from self: trait Parser { type Output<'a>; fn parse<'a>(&mut self, data: &'a [u8]) -> Self::Output<'a>;
} If you were to implement Parser for some reference type (in this case, &'b Dummy) you can now set Output to something that has no relation to 'b: impl<'b> Parser for &'b Dummy { type Output<'a> = &'a [u8]; fn parse<'a>(&mut self, data: &'a [u8]) -> Self::Output<'a> { data }
} Note that you would need a similar where clause if you were going to have a setup like: trait Transform<Input> { type Output<'a> where Input: 'i; fn transform<'i>(&mut self: &'i Input) -> Self::Output<'i>;
}

