In the previous example, the lifetime parameter for Output was not related to the self parameter. Are there (realistic) examples where the associated type is applied to the lifetime parameter from self but the where Self: 'a is not desired? There are some, but they rely on having "special knowledge" of the types that will be used in the impl, and they don't seem especially realistic. The reason is that, if you have a GAT with a lifetime parameter, it is likely that the GAT contains some data borrowed for that lifetime! But if you use the lifetime of self, that implies we are borrowing some data from self -- however, it doesn't necessarily imply that we are borrowing data of any particular type. Consider this example: trait Message { type Data<'a>: Display; fn data<'b>(&'b mut self) -> Self::Data<'b>; fn default() -> Self::Data<'static>;
} struct MyMessage<T> { text: String, payload: T,
} impl<T> Message for MyMessage<T> { type Data<'a>: Display = &'a str; // No requirement that `T: 'a`! fn data<'b>(&'b mut self) -> Self::Data<'b> { // In here, we know that `T: 'b` } fn default() -> Self::Data<'static> { "Hello, world" }
} Here the where T: 'a requirement is not necessary, and may in fact be annoying when invoking <MyMessage<T> as Message>::default() (as it would then require that T: 'static). Another possibility is that the usage of <MyMessage<T> as Message>::Data<'static> doesn't appear inside the trait definition, although it is hard to imagine exactly how one writes a useful function like that in practice.

