The current syntax for where to place the "where clause" of a generic associated types is awkward. Consider this example ( playground ): trait Iterable { type Iter<'a> where Self: 'a; fn iter(&self) -> Self::Iter<'_>;
} impl<T> Iterable for Vec<T> { type Iter<'a> where Self: 'a = <&'a [T] as IntoIterator>::IntoIter; fn iter(&self) -> Self::Iter<'_> { self.iter() }
} Note the impl. Most people expect the impl to be written as follows (indeed, the author wrote it this way in the first draft): impl Iterable for Vec<T> { type Iter<'a> = <&'a [T] as Iterator>::Iter where Self: 'a; fn iter(&self) -> Self::Iter<'_> { self.iter() }
} However, this placement of the where clause is in fact rather inconsistent, since the = <&'a [T] as Iterator>::Iter is in some sense the "body" of the item. The same current syntax is used for where clauses on type aliases ( playground ): type Foo<T> where T: Eq = Vec<T>; fn main() { }
